                tmp = head
            else:
                tmp.next = Node(i, None)
                tmp = tmp.next
        return head

    def detectCycle(head):
        if not head or not head.next:
            return False
        slow = head
        fast = head.next
        while fast is not slow:
            if not fast or not fast.next:
                return False
            slow = slow.next
            fast = fast.next.next
        return True

