def solution(stdin: str) -> str:
    """
    The trick here is to use a stack. We first push A and B in it, then push C in it and the stack will be in the right order.
    """
    stack = []
    nums = stdin.split()
    for i in range(3):
        stack.append(nums[i])

    order = stdin.split()[-1]

    if order == "AC":
        for i in range(3):
            if stack[i] == "A":
                stack[i] = stack.pop()
            if stack[i] == "B":
                stack[i] = stack.pop(1)
            if stack[i] == "C":
                stack[i] = stack.pop(2)

    elif order == "BC":
        for i in range(3):
            if stack[i] == "A":
                stack[i] = stack.pop()
            if stack[i] == "B":
                stack[i] = stack.pop(0)
            if stack[i] == "C":
                stack[i] = stack.pop(2)

    elif order == "CA":
        for i in range(3):
            if stack[i] == "A":
                stack[i] = stack.pop(0)
            if stack[i] == "B":
                stack[i] = stack.pop()
            if stack[i] == "C":
                stack[i] = stack.pop()

    for i in range(3):
        stack.append(nums[i])

    return " ".join(stack)

