    def land(i, j):
        nonlocal r, c
        islands.append((i, j))
        for ii, jj in ((i + 1, j), (i - 1, j), (i, j + 1), (i, j - 1)):
            if not (0 <= ii < r and 0 <= jj < c):
                return False
            if not is_land(ii, jj):
                land(ii, jj)
        return True
