    n = int(stdin)
    s = list(map(int, stdin.split()))
    if n == 1:
        return "impossible"
    rooms = [[] for _ in range(n)]
    while s:
        rooms[s.pop() % n].append(s.pop())
    dist_rooms = list(zip(*rooms))
